* After Sex *

Jeremy : next review, Same time babe?

Stuckman : yeah sure thing baby (;

@BeyondTheTrailer So I think the meaning of the movie and the ending was that it’s a fairytale, literally a once upon a time, and in that sense it’s genius, especially in comparison to other depictions of the murders such as American Horror Story and the Haunting of Sharon Tate, which both fantasises the actual murders as a one dimensional slasher story, and Debra Tate (Sharon’s own sister) agrees that this film is much more respectable and honourable to Sharon- especially since Tarantino reached out to her in particular to come on set and she says “I never really wanted to leave”. 
So I think the main criticism of the Manson Family is more of an after thought, however I do agree. For starters Steven Parent I think his name was is completely cut from the film, who was in his car nearby and was tragically shot and killed. I’m not saying he should have died anyway, but at least a mention like you see him drive away or something. But also the fact that Pitt’s character was high, I do feel that they almost dishonour the real people. Jay Sebring who is the man talking to Dicapprio at the end (perfectly cast by the way), tries to defend and protect Sharon in real life and was killed for his efforts... Meanwhile the two stars do it pretty easily... turning it to slapstick. 
I think if Cliff or Rick actually died, giving their life to save the other and the people next door, it would have been better... Pitt is hospitalised but is obviously going to be okay, killing him off would probably make the Mansons just as dangerous as they really are, and instead of coming in for a good few drinks, he mourns to Tate and the others...
